import React from 'react';

import Question3 from '../question/question3';

function Step3() {
  return (
    <>
      <p>Select your life core values. In other words, select what you want to experience in your daily life, making them habits you believe will move you towards your Vision. (Select 5 values).</p>
      <Question3 />
    </>
  );
}

export default Step3;
